export const getThumbNails = () => {
  return async (dispatch) => {
    const response = await fetch(
      "https://jsonplaceholder.typicode.com/photos/"
    );
    const data = await response.json();

    const albumArr = await data
      .filter((album) => album.albumId === 1)
      .map((photo) => {
        return { image: photo.thumbnailUrl, id: photo.id };
      });

    dispatch({
      type: "FETCH_THUMBNAILS",
      payload: albumArr,
    });
  };
};
